import React from 'react'
function TodoList(todos) {
    return (
        <div>
            {todos.map((todo) => (
                <input type='text' className='newtodo' key={todo.id}>
                    {todo.title}
                </input>
            ))}
        </div>
    )
}
export default TodoList
